import React, { Component } from 'react'

export class Tree extends Component {
  constructor() {
      this.state = {
          id: 1,
          name: "test"
      };
  }

  render() {
    return (
        <div id="tree">
        <p>{this.state.id}</p>
      </div>
    )
  }
}

export default Tree
